75156	42	5602	0	custom_sql	0.00	SELECT\r\n\t${COURRIER_ID}::bigint AS document,\r\n\tu_sdis.prenom || ' ' || u_sdis.nom AS nom_destinataire,\r\n\t'UTILISATEUR'::text AS type_destinataire,\r\n\tu_sdis.id AS id_destinataire,\r\n\tu_sdis.email AS email_destinataire\r\nFROM\r\n\t-- Collectivit territoriale  informer\r\n\t(SELECT\r\n\t\torg.nom,\r\n\t\tzc.geometrie\r\n\tFROM\r\n\t\t(SELECT\tnom,zone_competence FROM remocra.organisme WHERE id = ${ORGANISME_COLLECTIVITE_ID} AND actif) AS org\r\n\t\tJOIN remocra.zone_competence zc ON(zc.id = org.zone_competence)\r\n\t) AS o_ct\r\n\t-- Utilisateurs "Affaire suivie par"\r\n\tLEFT JOIN (SELECT\r\n\t\tu.id,\r\n\t\tu.nom,\r\n\t\tu.prenom,\r\n\t\tu.email,\r\n\t\tzc.geometrie\r\n\tFROM\r\n\t\t(SELECT\t* FROM remocra.utilisateur WHERE actif AND profil_utilisateur = ${PROFIL_UTILISATEUR_ID}) AS u\r\n\t\tJOIN remocra.organisme org ON(org.id = u.organisme)\r\n\t\tJOIN remocra.zone_competence zc ON(zc.id = org.zone_competence)\r\n\t) AS u_sdis ON (u_sdis.geometrie && o_ct.geometrie AND St_Intersects(u_sdis.geometrie,o_ct.geometrie))
