123142	90	6951	0	sql	0	SELECT \r\n\tal_total.rapporteur,\r\n\tu.nom,\r\n\tu.prenom,\r\n\tu.identifiant,\r\n\tal_total.nb_alertes,\r\n\tCOALESCE(al_valid.nb_alertes_valide,0) as nb_alertes_valide,\r\n\tCOALESCE(al_non_valid.nb_alertes_refusees,0) as nb_alertes_refusees,\r\n\tCOALESCE(al_to_valid.nb_alertes_a_valider,0) as nb_alertes_a_valider,\r\n\torg.nom as organisme_cis\r\nFROM\r\n\t(\r\n\t\tSELECT \r\n\t\t\ta.rapporteur,\r\n\t\t\tcount(*) nb_alertes,o.id as id_organisme\t\t\t\t\r\n\t\tFROM\r\n\t\t\t${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.alerte a \r\n\t\t\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.utilisateur u on (a.rapporteur = u.id)\r\n\t\t\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.organisme o on (u.organisme = o.id)\r\n\t\t\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.type_organisme tyo on (o.type_organisme = tyo.id)\r\n\t\t\tWHERE ((${ORGANISME_CIS_ID} !=  -1 and  tyo.code = 'CIS' and o.id  = ${ORGANISME_CIS_ID} )  or (-1 = ${ORGANISME_CIS_ID} and  tyo.code in ('CIS','SDIS')))\r\n\t\t\tAND a.date_constat between ${date_debut_sql} and ${date_fin_sql} \r\n\t\tGROUP BY a.rapporteur, o.id\t\r\n\t) al_total\r\n\tLEFT JOIN\r\n\t(\r\n\t\t-- Alertes valides\r\n\t\tSELECT \r\n\t\t\ta.rapporteur,\t\t\r\n\t\t\tcount(*) as  nb_alertes_valide\t\t\r\n\t\tFROM\r\n\t\t\t${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.alerte a \r\n\t\t\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.utilisateur u on (a.rapporteur = u.id)\r\n\t\t\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.organisme o on (u.organisme = o.id)\r\n\t\t\tJOIN remocra.type_organisme tyo on (o.type_organisme = tyo.id)\r\n\t\t\tWHERE  a.etat = true and ((${ORGANISME_CIS_ID} !=  -1 and  tyo.code = 'CIS' and o.id  = ${ORGANISME_CIS_ID} )  or (-1 = ${ORGANISME_CIS_ID} and  tyo.code in ('CIS','SDIS')))\r\n\t\t\tAND a.date_constat between ${date_debut_sql} and ${date_fin_sql} \r\n\t\tGROUP BY a.rapporteur\t\r\n\t) al_valid \r\n\tON al_total.rapporteur = al_valid.rapporteur\r\n\tLEFT JOIN\r\n\t(\r\n\t\t--- Alertes refuses\r\n\t\tSELECT \r\n\t\t\ta.rapporteur,\r\n\t\t\tcount(*) nb_alertes_refusees\t\t\r\n\t\tFROM \r\n\t\t\t${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.alerte a \r\n\t\t\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.utilisateur u on (a.rapporteur = u.id)\r\n\t\t\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.organisme o on (u.organisme = o.id)\r\n\t\t\tJOIN remocra.type_organisme tyo on (o.type_organisme = tyo.id)\r\n\t\t\twhere a.etat = false and ((${ORGANISME_CIS_ID} !=  -1 and  tyo.code = 'CIS' and o.id  = ${ORGANISME_CIS_ID} )  or (-1 = ${ORGANISME_CIS_ID} and  tyo.code in ('CIS','SDIS')))\r\n\t\t\tAND a.date_constat between ${date_debut_sql} and ${date_fin_sql}\r\n\t\tGROUP BY a.rapporteur\r\n\r\n\t) al_non_valid\r\n\tON al_total.rapporteur = al_non_valid.rapporteur\r\n\tLEFT JOIN\r\n\t(\r\n\t--- Alertes  valider\r\n\t\tSELECT \r\n\t\t\ta.rapporteur,\r\n\t\t\tcount(*) nb_alertes_a_valider\t\t\r\n\t\tFROM \r\n\t\t\t${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.alerte a \r\n\t\t\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.utilisateur u on (a.rapporteur = u.id)\r\n\t\t\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.organisme o on (u.organisme = o.id)\r\n\t\t\tJOIN remocra.type_organisme tyo on (o.type_organisme = tyo.id)\r\n\t\t\tWHERE a.etat is null and ((${ORGANISME_CIS_ID} !=  -1 and  tyo.code = 'CIS' and o.id  = ${ORGANISME_CIS_ID} )  or (-1 = ${ORGANISME_CIS_ID} and  tyo.code in ('CIS','SDIS')))\r\n\t\t\tAND a.date_constat between ${date_debut_sql} and ${date_fin_sql}\r\n\t\tGROUP BY a.rapporteur\r\n\t) al_to_valid\r\n\tON al_total.rapporteur = al_to_valid.rapporteur\r\n\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.utilisateur u\r\n\tON al_total.rapporteur = u.id\r\n\t-- Organisme\r\n\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.organisme org on (org.id = id_organisme)\r\nORDER BY organisme_cis,nom
