100770	72	5798	0	sql	0	select \n    h.id,\n\th.numero, h.voie, h.voie2 as carrefour, domaine.nom as domaine, \n\tnature.nom as type_hydrant, \r\n    vol.nom as vol_constate,\r\n    pena.capacite,\n\th.observation as observation,\r\n\tCASE \tWHEN h.dispo_terrestre ='INDISPO' THEN 'Indisponible'\r\n            WHEN h.dispo_terrestre ='NON_CONFORME' THEN 'Non conforme'\r\n            WHEN h.dispo_terrestre ='DISPO' THEN 'Disponible'\r\n\t\t\tELSE ''\r\n    END as disponibilite,\r\n\tCASE \tWHEN h.dispo_hbe ='INDISPO' THEN 'Indisponible'\r\n            WHEN h.dispo_hbe ='NON_CONFORME' THEN 'Non conforme'\r\n            WHEN h.dispo_hbe ='DISPO' THEN 'Disponible'\r\n\t\t\tELSE ''\r\n    END as disponibilite_hbe,\r\n\ta.anomalie,\th.date_contr as date_controle, h.date_reco as date_reconaissance\nfrom ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.hydrant h\n-- anomalies concatnes dans une colonne\nleft outer join ( \n\tselect ha.hydrant, array_to_string(array_agg(a.nom), E'\\r\\n') as anomalie\n    from ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.hydrant_anomalies ha\n\tleft outer join ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.type_hydrant_anomalie a on  ha.anomalies = a.id \n    group by ha.hydrant   \n) a on h.id = a.hydrant\nleft outer join ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.type_hydrant_domaine domaine on h.domaine = domaine.id\nleft outer join ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.type_hydrant_nature nature on h.nature = nature.id\n-- hydrant PENA uniquement\njoin ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.hydrant_pena pena on h.id =  pena.id\r\nleft outer join ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.type_hydrant_vol_constate vol on pena.vol_constate = vol.id\nwhere h.commune = ${COMMUNE_ID}\r\n\tand ( dispo_terrestre = 'INDISPO' OR  dispo_hbe = 'INDISPO' )\r\n\tand date_trunc('day',GREATEST(h.date_contr,h.date_reco, h.date_verif,h.date_recep))  = DATE 'yesterday' \r\norder by h.numero
