103099	76	5895	0	sql	0	select  libelle_domaine, libelle_disponibilite, count(h.id) nombre\r\nfrom\r\n(\r\n  select row_number() over(order by id_domaine nulls LAST, id_disponibilite ) as ordre, domaine.*, disponibilite.* from \r\n    (\r\n      select id as id_domaine, nom as libelle_domaine from ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.type_hydrant_domaine \r\n        union\r\n      select null as id_domaine, 'Non renseign' as libelle_domaine  \r\n    ) domaine,\r\n    (\r\n        select 1 as id_disponibilite, 'INDISPO' as code_disponibilite, 'Indisponible' as libelle_disponibilite\r\n        union\r\n        select 2 as id_disponibilite, 'DISPO' as code_disponibilite, 'Disponible' as libelle_disponibilite\r\n    ) disponibilite\r\n    order by ordre\r\n) t \r\nleft outer join ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.hydrant h on h.dispo_terrestre  = t.code_disponibilite and h.domaine = t.id_domaine and h.commune = ${COMMUNE_ID} and h.dispo_terrestre is not null and h.code= 'PENA'\r\ngroup by ordre, libelle_domaine, libelle_disponibilite\r\norder by ordre
