138207	97	7779	0	class_source	0	import java.io.File;\r\nimport java.io.FileInputStream;\r\nimport java.security.KeyStore;\r\nimport java.security.PrivateKey;\r\nimport java.security.cert.Certificate;\r\n\r\nimport com.lowagie.text.pdf.PdfReader;\r\nimport com.lowagie.text.pdf.PdfSignatureAppearance;\r\nimport com.lowagie.text.pdf.PdfStamper;\n\r\n\r\nString pfxFile;\nString pfxPassword;\nString keyPassword;\r\nString pdfInFile;\r\n\npublic boolean processRow(StepMetaInterface smi, StepDataInterface sdi) throws KettleException{\n\n\tObject[] r = getRow();\n\n\tif (r == null) {\n\t\tsetOutputDone();\n\t\treturn false;\n\t}\n\n\tif (first) {\n\n\t    first=false;\n\t}\n\n    Object[] outputRow = createOutputRow(r, data.outputRowMeta.size());\n\n\t//Rcupration des informations de signature\r\n\tpfxFile = get(Fields.In, "fichier_pfx").getString(r);\r\n\tpfxPassword = get(Fields.In, "mot_de_passe_pfx").getString(r);\r\n\tkeyPassword = get(Fields.In, "mot_de_passe_clef").getString(r);\n\tpdfInFile = get(Fields.In, "fichier_pdf").getString(r);\r\n\r\n\ttry{\r\n\r\n\t\t//Certificat\r\n\t\tKeyStore keyStore = KeyStore.getInstance("pkcs12");\r\n\t\tkeyStore.load(new FileInputStream(pfxFile), pfxPassword.toCharArray());\r\n\t\tString alias = (String)keyStore.aliases().nextElement();\r\n\t\r\n\t\t// Recupration de la clef prive et de la chaine de certificats\r\n\t\tPrivateKey key = (PrivateKey)keyStore.getKey(alias, pfxPassword.toCharArray());\r\n\t\tCertificate[] chain = keyStore.getCertificateChain(alias);\r\n\t\t \r\n\t\t// Lecture du document source\r\n\t\tPdfReader pdfReader = new PdfReader(new File(pdfInFile).getAbsolutePath());\r\n\t\tFile outputFile = new File(pdfInFile.replace(".","_SIGNE."));\r\n\t\t\r\n\t\t// Creation du tampon de signature\r\n\t\tPdfStamper pdfStamper;\r\n\t\tpdfStamper = PdfStamper.createSignature(pdfReader, null, '\\0', outputFile);\r\n\t\tPdfSignatureAppearance sap = pdfStamper.getSignatureAppearance();\r\n\t\tsap.setCrypto(key, chain, null, PdfSignatureAppearance.SELF_SIGNED);\r\n\t\tpdfStamper.setFormFlattening(true);\r\n\t\tpdfStamper.close();\r\n\r\n\t\t//Suppression du PDF non sign\r\n\t\t//et renommage du PDF sign\r\n\t\tnew File(pdfInFile).delete();\r\n\t\toutputFile.renameTo(new File(pdfInFile));\r\n\t\t\n\t}catch (Exception e) {\n\t\tnew KettleException();\n\t}\n\n    putRow(data.outputRowMeta, outputRow);\n\n\treturn true;\n}
