156364	9	8710	0	class_source	0	import javax.mail.*;\nimport javax.mail.internet.InternetAddress;\nimport javax.mail.internet.MimeMessage;\nimport java.util.Properties;\n\nSession session;\r\n\nString smtpHost; // Host du STMP\nString smtpPort; // Port du STMP\nString smtpUser; // User name du SMTP\nString smtpPassword;//User password du SMTP\r\nString smtpReponseMail; //Adresse ml de rponse\r\nString smtpARMail;\t// Adresse ml de retour des accuss des rcption\r\nString smtpErreurMail; //Adresse ml de retour des erreurs de dlivrance\n\nString messageID; // Identifiant de message gnr par rmocra\nString messageExpediteurNom; // Nom de l'expditeur\nString messageExpediteurMail; // Adresse ml de l'expditeur\nString messageDestinataireNom; // Nom du destinataire\nString messageDestinataireMail; // Adresse ml du destinataire\nString messageObjet; // Objet du ml\nString messageCorps; // Corps du ml en HTML\r\nBoolean messageAR;  // Demander accus de rception\r\n\npublic boolean processRow(StepMetaInterface smi, StepDataInterface sdi) throws KettleException{\n\n\tObject[] r = getRow();\n\n\tif (r == null) {\n\t\tsetOutputDone();\n\t\treturn false;\n\t}\n\n\tif (first) {\n\r\n\t\t//Rcupration des paramtres du service SMTP\n\t\tsmtpHost = get(Fields.In, "smtp_url").getString(r);\n\t\tsmtpPort = get(Fields.In, "smtp_port").getString(r);\n\t\tsmtpUser = get(Fields.In, "smtp_user").getString(r);\n\t\tsmtpPassword = get(Fields.In, "smtp_password").getString(r);\r\n\t\tsmtpErreurMail = get(Fields.In, "erreur_delivrance_mail").getString(r);\n\n\t\tProperties properties = new Properties();\n\t\tproperties.put("mail.smtp.host", smtpHost);\n\t\tproperties.put("mail.smtp.port", smtpPort);\r\n\t\tproperties.put("mail.smtp.connectiontimeout", "1500");\r\n    \tproperties.put("mail.smtp.timeout", "1500");\r\n\r\n\t\t//Adresse ml de reception des erreurs\r\n\t\tproperties.put("mail.smtp.from", smtpErreurMail);\n\r\n\t\t//Cration d'un session\n\t\tAuthenticator authenticator = new javax.mail.Authenticator() {  \n\t\t\tprotected PasswordAuthentication getPasswordAuthentication() {  \n\t\t\t\treturn new PasswordAuthentication(smtpUser,smtpPassword);  \n\t\t\t}\r\n\t\t};\n\n\t\t//session = Session.getDefaultInstance(properties,authenticator);\r\n\t\tsession = Session.getInstance(properties,authenticator);\n\n\t    first=false;\n\t}\n\n    Object[] outputRow = createOutputRow(r, data.outputRowMeta.size());\n\r\n\t//Rcupration des informations sur le message  envoyer\n\tmessageID = get(Fields.In, "code").getString(r);\n\tmessageExpediteurNom = get(Fields.In, "expediteur").getString(r);\n\tmessageExpediteurMail = get(Fields.In, "expediteur_email").getString(r);\n\tmessageDestinataireNom = get(Fields.In, "destinataire").getString(r);\n\tmessageDestinataireMail = get(Fields.In, "destinataire_email").getString(r);\n\tmessageObjet = get(Fields.In, "objet").getString(r);\n\tmessageCorps = get(Fields.In, "corps").getString(r);\r\n\tmessageAR = get(Fields.In, "accuser_reception").getBoolean(r);\r\n\r\n\tsmtpReponseMail = get(Fields.In, "reponse_mail").getString(r);\r\n\tsmtpARMail = get(Fields.In, "accuse_reception_mail").getString(r);\n\n\ttry{\n\n\t\t//Nouveau message avec ID personnalis\n\t\tMimeMessage message = new MimeMessage(session) {\n\t\t\tprotected void updateMessageID() throws MessagingException {\n\t\t        setHeader("Message-ID", messageID);\n\t\t    }\n\t\t};\r\n\r\n\t\t//Accus de rcption du mel si dmand pour le mail et adresse non nulle\r\n\t\tif(messageAR\r\n\t\t\t&& smtpARMail != null\r\n\t\t\t&& !smtpARMail.isEmpty())\r\n\t\t{\r\n\t\t\tmessage.setHeader("Disposition-Notification-To", smtpARMail);\r\n\t   \t\tmessage.setHeader("Return-Receipt-To", smtpARMail);\r\n\t\t};\n\n\t\t//Expditeur\n     \tmessage.setFrom(\n\t\t\tnew InternetAddress(messageExpediteurMail, messageExpediteurNom)\n\t\t);\r\n\n\t\t//Destinataire  \n     \tmessage.addRecipient(\n\t\t\tMessage.RecipientType.TO,\n\t\t\tnew InternetAddress(messageDestinataireMail, messageDestinataireNom)\n\t\t);\r\n\r\n\t\t//Adresse de rponse\r\n\t\tmessage.setReplyTo(new InternetAddress[]{new InternetAddress(smtpReponseMail)});\r\n\r\n\n    \t//Objet et corps HTML en UTF8\n\t\tmessage.setSubject(messageObjet,"UTF-8");\n\t\tmessage.setContent(messageCorps,"text/html; charset=UTF-8");\n\t      \t\n\t\t//Envoyer le message\n\t\tTransport.send(message);\n\t\t\n\t}catch (Exception e) {\n\t\t\tnew KettleException(e.toString());\n\t}\n\n    putRow(data.outputRowMeta, outputRow);\n\n\treturn true;\n}
